DEMOCRACIA EM FRANGALHOS:

- ABERTURA ILEGAL DE INQUÉRITOS;

- ADVOGADOS SEM ACESSO AOS INQUÉRITOS;

- PRISÕES SEM CRIME NO CÓDIGO PENAL E SEM JULGAMENTO;

- DESTRUIÇÃO DAS LIBERDADES INDIVIDUAIS;

- DESTRUIÇÃO DO ESTADO DE DIREITO;

- DESMORALIZAÇÃO DO STF E DEMAIS INSTITUIÇÕES;

A omissão de Rodrigo Pacheco diante dos ataques a Constituição e ao Estado de Direito, promovidos por Alexandre de Moraes, colocam o Senado como cúmplice.
